import '../App.css';
// src/pages/Articles.js
function Articles() {
  return (
    <div className="App-content">
      <h2>Welcome to my site</h2>
      <p>Here you will find useful articles about QA and automation, tips, links and information about me.</p>
    </div>
  );
}

export default Articles;
